import logo from "./logo.svg";
import "./App.css";

export default function App() {
  return (
    <>
      <Step />
      <Counter />
      <DateCounter />
    </>
  );
}

function Step() {
  return <div>TEST Step</div>;
}

function Counter() {
  return <div>TEST Counter</div>;
}

function DateCounter() {
  return <div>TEST DateCounter</div>;
}
